import React from 'react';
import { useNavigate } from 'react-router-dom';
import Button from '@mui/material/Button';
import cesar from '../assets/images/cesar.png'; // Nueva ruta correcta

const TiposCifrado = () => {
  const navigate = useNavigate();

  return (
    <div className="tipos-cifrado-container">
      <h1>Elige un tipo de Cifrado</h1>
      <div className="buttons-container">
        <Button
          variant="contained"
          color="primary"
          onClick={() => navigate('/cesar')}
          className="cifrado-button"
        >
          Cifrado César
        </Button>
        {/* Cambié "image" por "img" */}
        <img src={cesar} alt="Cifrado César" style={{ width: '200px', height: 'auto' }} />
        <Button
          variant="contained"
          color="secondary"
          onClick={() => navigate('/escitala')}
          className="cifrado-button"
        >
          Cifrado Escítala
        </Button>
      </div>
    </div>
  );
};

export default TiposCifrado;
